const express = require("express");
const { ApolloServer, addMockFunctionsToSchema, makeExecutableSchema } = require("apollo-server-express");
const { importSchema } = require("graphql-import");
const moment = require("moment");
const schemaString = importSchema("schema.graphql");

function generateUuid() {
  let chars = "xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx".split("");
  for (let i = 0, len = chars.length; i < len; i++) {
    switch (chars[i]) {
      case "x":
        chars[i] = Math.floor(Math.random() * 16).toString(16);
        break;
      case "y":
        chars[i] = (Math.floor(Math.random() * 4) + 8).toString(16);
        break;
    }
  }
  return chars.join("");
}

const schema = makeExecutableSchema({ typeDefs: schemaString });
addMockFunctionsToSchema({ schema });

const app = express();

const server = new ApolloServer({
  schema,
  mocks: {
    Query: () => ({
      node: (_, { id }) => {
        const [typeName] = Buffer.from(id, "base64").toString("binary").split(":");

        return {
          id: id,
          __typename: typeName,
          __resolveType(node, _context, _info) {
            return typeName;
          },
        };
      },
      currentAccount: () => {
        return {
          __resolveType(node, _context, _info) {
            return "Account";
          },
          id: "QWNjb3VudDowZGY2YjAyYy05OWQ5LTRiZWYtOTY2MC0xYWI4NzMxMTMyNWU=",
        };
      },
    }),
    Task: () => ({
      id: () => {
        return Buffer.from(`Task:${generateUuid()}`).toString("base64");
      },
      __resolveType(obj, _context, _info) {
        return "Task";
      },
    }),
    Project: () => ({
      id: () => {
        return Buffer.from(`Project:${generateUuid()}`).toString("base64");
      },
      __resolveType(obj, _context, _info) {
        return "Project";
      },
    }),
    ProjectMembership: () => ({
      id: () => {
        return Buffer.from(`ProjectMembership:${generateUuid()}`).toString("base64");
      },
      __resolveType(obj, _context, _info) {
        return "ProjectMembership";
      },
    }),
    Account: () => ({
      id: () => {
        return Buffer.from(`Account:${generateUuid()}`).toString("base64");
      },
      __resolveType(obj, _context, _info) {
        return "Account";
      },
    }),
    DateTime: () => {
      return moment();
    },
    Date: () => {
      return moment().format("YYYY-MM-DD");
    },
    HexColor: () => {
      return "de2edd";
    },
    EncodedImage: () => {
      return "data:image/jpeg;base64,";
    },
  },
  cors: {
    origin: "*",
    credentials: true
  }
});
server.applyMiddleware({ app });

app.listen({ port: 4000, path: "/graphql" }, () => {
  console.log(`🚀 Server is ready`);
});
